var request = require('request');

const UseInd = '  ';

function Make_it_current( indent, it, chNum )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<current>' + '\r\n';
    if(chNum==1) {
        S += indent + lInd + '<unix_time>'+it.ch1.current.unix_time+'</unix_time>' + '\r\n';
        S += indent + lInd + '<time_str>'+it.ch1.current.time_str+'</time_str>' + '\r\n';
        S += indent + lInd + '<value valid="true">'+it.ch1.current.value+'</value>' + '\r\n';
        S += indent + lInd + '<unit>'+it.ch1.current.unit+'</unit>' + '\r\n';
        S += indent + lInd + '<batt>'+it.ch1.current.batt+'</batt>' + '\r\n';
    }
    if(chNum==2) {
        S += indent + lInd + '<unix_time>1499062406</unix_time>' + '\r\n';
        S += indent + lInd + '<time_str>2017/07/03 15:13:26</time_str>' + '\r\n';
        S += indent + lInd + '<value valid="true">24.3</value>' + '\r\n';
        S += indent + lInd + '<unit>C</unit>' + '\r\n';
        S += indent + lInd + '<batt>5</batt>' + '\r\n';
    }
    S += indent + '</current>' + '\r\n';
    return(S);
}

function Make_it_record( indent, it, chNum )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<record>' + '\r\n';

    if(chNum==1) {
        S += indent + lInd + '<type>'+it.ch1.record.type+'</type>' + '\r\n';
        S += indent + lInd + '<unix_time>'+it.ch1.record.unix_time+'</unix_time>' + '\r\n';
        S += indent + lInd + '<data_id>'+it.ch1.record.data_id+'</data_id>' + '\r\n';
        S += indent + lInd + '<interval>'+it.ch1.record.interval+'</interval>' + '\r\n';
        S += indent + lInd + '<count>'+it.ch1.record.count+'</count>' + '\r\n';
        S += indent + lInd + '<data>' + '\r\n';
        S += indent + lInd + it.ch1.record.data  + '\r\n';
        //S += indent + lInd + '' + '\r\n';
        S += indent + lInd + '</data>' + '\r\n';
    }
    /*
    if(chNum==2) {
        S += indent + lInd + '<type>269</type>' + '\r\n';
        S += indent + lInd + '<unix_time>1499062346</unix_time>' + '\r\n';
        S += indent + lInd + '<data_id>0</data_id>' + '\r\n';
        S += indent + lInd + '<count>2</count>' + '\r\n';
        S += indent + lInd + '<interval>20</interval>' + '\r\n';
        S += indent + lInd + '<data>' + '\r\n';
        S += indent + lInd + 'SuBZWQAAAAD5BIbgWVkAAAAA+QQ=</data>' + '\r\n';
    }
    */
    S += indent + '</record>' + '\r\n';
    return(S);
}

function Make_it_channel( indent, it, chNum )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<ch>' + '\r\n';
    S += indent + lInd + '<num>'+ chNum +'</num>' + '\r\n';
    S += indent + lInd + '<scale_expr></scale_expr>' + '\r\n';
    if(chNum==1)
        S += indent + lInd + '<name>Temp_Ble</name>' + '\r\n';
    /*
    if(chNum==2)
        S += indent + lInd + '<name>Temp_Moni</name>' + '\r\n';
    */
    S += Make_it_current(indent + lInd, it, chNum);
    S += Make_it_record(indent + lInd, it, chNum);
    S += indent + '</ch>' + '\r\n';
 
    return(S);
}

function Make_it_remote( indent, it )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<remote>' + '\r\n';
    S += indent + lInd + '<serial>'+it.base.serial.toString(16).toUpperCase()+'</serial>' + '\r\n';
    S += indent + lInd + '<model>'+it.base.model+'</model>' + '\r\n';
    S += indent + lInd + '<num>1</num>' + '\r\n';
    S += indent + lInd + '<name>'+it.base.name+'</name>' + '\r\n';
    S += indent + lInd + '<rssi></rssi>' + '\r\n';
    S += Make_it_channel(indent + lInd, it, 1);
    //S += Make_it_channel(indent + lInd, it, 2);
    S += indent + '</remote>' + '\r\n';
    return(S);
}

function Make_it_group( indent, it )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<group>' + '\r\n';
    S += indent + lInd + '<num>0</num>' + '\r\n';
    S += indent + lInd + '<name></name>' + '\r\n';
    S += Make_it_remote(indent + lInd, it);
    S += indent + '</group>' + '\r\n';
    return(S);
}

function Make_it_base( indent, it )
{
    let S = "";
    var lInd = UseInd;
    S += indent + '<base>' + '\r\n';
    S += indent + lInd + '<serial>' +it.base.serial.toString(16).toUpperCase() +'</serial>' + '\r\n';
    S += indent + lInd + '<model>' + it.base.model + '</model>' + '\r\n';
    S += indent + lInd + '<name>' + it.base.name + '</name>' + '\r\n';
    S += indent + lInd + '<time_diff>' + it.base.time_diff + '</time_diff>' + '\r\n'; // 540 for Japan
    S += indent + lInd + '<std_bias>0</std_bias>' + '\r\n'; // Standard Time
    S += indent + lInd + '<dst_bias>0</dst_bias>' + '\r\n'; // DayLightSaving Time
    S += indent + lInd + '<time_zone></time_zone>' + '\r\n';
    S += indent + '</base>' + '\r\n';
    return(S);
}

function Make_it( it )
{
    let S = "";
    let indent = UseInd;
    
    S += '----boudary_tr4' + '\r\n';
    S += 'Content-Disposition: form-data; name="tr4"; filename="/storage/emulated/0/tr4/TR4_WS_5E2E0205_1499062439756.xml"' + '\r\n';
    S += 'Content-Type: application/octet-stream' + '\r\n';
    S += '\r\n';
    //S += 'c=3,s=5E2E0205' + '\r\n';
    S += 'c=3,s=' + it.base.serial.toString(16).toUpperCase() + '\r\n';
    S += '<?xml version="1.0" encoding="UTF-8"?>' + '\r\n';
    S += '<file format="current_readings" version="1.24" name="/storage/emulated/0/tr4/TR4_WS_5E2E0205_1499062439756.xml">' + '\r\n';

    S += Make_it_base( indent, it);
    S += Make_it_group( indent, it);

    S += '</file>' + '\r\n';
    S += '----boudary_tr4--' + '\r\n';
    
    return(S);
}



var jsonfile = require('jsonfile')
var itparamsfile = './itparams.json'
let it = {}
postPit_Load = function()
{
    try {
        it = jsonfile.readFileSync(itparamsfile)
    }
    catch(error)
    {
        console.dir('error = ', error);
        it = {};
    }
}

function tr4postit()
{
    postPit_Load();

var bodyXml = Make_it(it);

// Set the headers
var headers = {
    'User-Agent':       'ThermoStorage/1.01',
    'Host':             'develop.webstorage.jp',
    //'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8',
    //'Connection: 'keep-alive',
    'Content-Type':     'multipart/form-data; boundary=--boudary_tr4'
    //'Content-Length': '1959'
}

// Set the options
var options = {
    url: 'http://develop.webstorage.jp/api/dev-tr4-1.php',
    method: 'POST',
    headers: headers,
    body: bodyXml
}

//console.log('--------------------------------------------------');
// Start the request
request(options, function (error, response, body) {
        if (!error && response.statusCode == 200) {
        // Print out the response body
        console.log(body)
    }
})
//console.log('--------------------------------------------------');

}

module.exports = tr4postit
